import React  from "react";
import Header from "./Header"
import Note from "./Note"
import Footer from "./Footer"
import notes from "../notes"


 (newNotes)=>{
return (
    <Note
    key={newNotes.id}
    title={newNotes.title}
    content={newNotes.content}
     />

)
}
function App()
{
    return(
        <div>
            <Header/>
            {notes.map(
 (newNotes)=>{
    return (
        <Note
        key={newNotes.id}
        title={newNotes.title}
        content={newNotes.content}
         />
    
    )
    }
            )}
            {/* <Note title="" content=""/> */}
            <Footer/>
        </div>
    );
}

export default App;
